import React from "react";
 
const Popup = props => {
  return (
    <div className="popup-box">
      <div className="box">
        <span className="close-icon" onClick={props.handleClose}>x</span>
        <div id="res_col">
            <h1>{"Результаты опроса: " + props.title}</h1>

        </div>
      </div>
    </div>
  );
};
 
export default Popup;
